        category: 'Entertainment',
        icon: <NightlifeIcon />,
        priceRange: '$$',
        giftIdeas: ['Concert Tickets', 'Dance Lesson Package', 'Group Event Vouchers', 'Bar Gift Cards']
      },
      {
