        category: 'Food & Sports',
        icon: <RestaurantIcon />,
        priceRange: '$$',
        giftIdeas: ['Game Day Package', 'Dining Gift Cards', 'Sports Memorabilia', 'Group Dining Vouchers']
      },
      {
        name: 'Ian\'s Pizza',
        description: 'Famous late-night pizza spot known for unique toppings. A must-visit for any Badger student.',
        category: 'Food & Dining',
        icon: <RestaurantIcon />,
        priceRange: '$',
        giftIdeas: ['Pizza Party Package', 'Gift Cards', 'Group Meal Vouchers', 'Late Night Food Package']
      },
      {
        name: 'Raising Cane\'s',
        description: 'Popular chicken finger restaurant with signature sauce. Perfect for quick meal gifts.',
        category: 'Food & Dining',
        icon: <RestaurantIcon />,
        priceRange: '$',
        giftIdeas: ['Gift Cards', 'Family Meal Package', 'Cane\'s Sauce Collection', 'Group Meal Vouchers']
      },
      {
        name: 'Monday\'s Bar',
        description: 'Classic college bar with great deals and lively atmosphere. Popular spot for student gatherings.',
        category: 'Entertainment',
        icon: <LocalBarIcon />,
        priceRange: '$',
        giftIdeas: ['Bar Gift Cards', 'Group Event Package', 'Game Day Specials', 'Student Night Passes']
      },
      {
        name: 'University Ridge Golf Course',
        description: 'Beautiful 18-hole golf course with stunning views. Perfect for golf enthusiasts and special occasions.',
        category: 'Experiences',
        icon: <NightlifeIcon />,
        priceRange: '$$$',
        giftIdeas: ['Golf Lesson Package', 'Round of Golf Vouchers', 'Golf Club Rental', 'Special Event Package']
      },
      {
        name: 'The Bookstore',
        description: 'Official UW-Madison bookstore with extensive Badger merchandise and student essentials.',
        category: 'Shopping',
        icon: <ShoppingBagIcon />,
        priceRange: '$$',
        giftIdeas: ['Textbook Gift Cards', 'Badger Apparel', 'Study Supplies', 'Campus Souvenirs']
      },
      {
        name: 'Hawks Bar and Grill',
        description: 'Sports bar with great food and game day atmosphere. Popular spot for watching Badger games.',
        category: 'Food & Sports',
        icon: <LocalBarIcon />,
        priceRange: '$$',
        giftIdeas: ['Game Day Package', 'Dining Gift Cards', 'Sports Memorabilia', 'Group Event Vouchers']
      },
      {
        name: 'Red Rock Saloon',
        description: 'Country-themed bar with mechanical bull and live music. Unique experience for special occasions.',
        category: 'Entertainment',
        icon: <NightlifeIcon />,
        priceRange: '$$',
        giftIdeas: ['Concert Tickets', 'Bull Riding Package', 'Group Event Vouchers', 'Bar Gift Cards']
      },
      {
        name: 'Sconnie Bar',
        description: 'Popular campus bar known for its Wisconsin-themed drinks and atmosphere. Great for Badger spirit gifts.',
        category: 'Badger Spirit',
        icon: <LocalBarIcon />,
        priceRange: '$$',
        giftIdeas: ['Bar Gift Cards', 'Wisconsin-themed Gifts', 'Game Day Package', 'Group Event Vouchers']
      }
    ]
  },
  {
    name: 'Vanderbilt University',
    hotspots: [
      {
        name: 'Vol Elrods',
        description: 'Classic Nashville bar with a rich history and great atmosphere. Perfect for Commodore fans and visitors.',
        category: 'Vandy Spirit',
        icon: <LocalBarIcon />,
        priceRange: '$$',
        giftIdeas: ['Bar Gift Cards', 'Game Day Package', 'Nashville Experience Vouchers', 'Group Event Passes']
      },
      {
        name: 'Jason Aldean\'s Kitchen + Rooftop Bar',
        description: 'Country star\'s upscale restaurant with rooftop views and live music. Great for special occasions.',
        category: 'Entertainment',
        icon: <NightlifeIcon />,
        priceRange: '$$$',
        giftIdeas: ['Dining Gift Cards', 'Rooftop Experience Package', 'Concert Tickets', 'Special Event Reservations']
      },
      {
        name: 'Friends Bar',
        description: 'Popular sports bar with great game day atmosphere and food specials. Perfect for Vandy game watching.',
        category: 'Sports & Dining',
        icon: <LocalBarIcon />,
        priceRange: '$$',
        giftIdeas: ['Game Day Package', 'Sports Memorabilia', 'Group Dining Vouchers', 'Bar Gift Cards']
      },
      {
        name: 'Kid Rock\'s Big Honky Tonk',
        description: 'Massive entertainment venue with live music and multiple bars. Iconic Nashville experience.',
        category: 'Entertainment',
        icon: <NightlifeIcon />,
        priceRange: '$$$',
        giftIdeas: ['Concert Tickets', 'VIP Experience', 'Group Event Packages', 'Nashville Night Out Package']
      },
      {
        name: 'Losers Bar and Grill',
        description: 'Beloved sports bar with great food and game day specials. Popular spot for Vandy students.',
        category: 'Sports & Dining',
        icon: <LocalBarIcon />,
        priceRange: '$$',
        giftIdeas: ['Game Day Package', 'Sports Memorabilia', 'Group Dining Vouchers', 'Bar Gift Cards']
      },
      {
        name: 'Taco Mama',
        description: 'Fresh and creative Mexican restaurant with a fun atmosphere. Great for casual dining gifts.',
        category: 'Food & Dining',
        icon: <RestaurantIcon />,
        priceRange: '$',
        giftIdeas: ['Gift Cards', 'Taco Party Package', 'Group Meal Vouchers', 'Student Meal Plans']
      },
      {
        name: 'Raising Cane\'s',
        description: 'Popular chicken finger restaurant with signature sauce. Perfect for quick meal gifts.',
        category: 'Food & Dining',
        icon: <RestaurantIcon />,
        priceRange: '$',
        giftIdeas: ['Gift Cards', 'Family Meal Package', 'Cane\'s Sauce Collection', 'Group Meal Vouchers']
      },
      {
        name: 'San Antonio Taco Co',
        description: 'Nashville\'s original taco spot with a unique atmosphere. Great for casual dining and group events.',
        category: 'Food & Dining',
        icon: <RestaurantIcon />,
        priceRange: '$',
        giftIdeas: ['Gift Cards', 'Taco Party Package', 'Group Event Vouchers', 'Student Meal Plans']
      },
      {
        name: 'Velvet Taco',
        description: 'Creative taco restaurant with unique flavors and late-night hours. Perfect for foodie gifts.',
        category: 'Food & Dining',
        icon: <RestaurantIcon />,
        priceRange: '$$',
        giftIdeas: ['Gift Cards', 'Taco Tasting Package', 'Late Night Food Vouchers', 'Group Dining Passes']
      },
      {
        name: 'Martin\'s Bar-B-Que Joint',
        description: 'Authentic Tennessee barbecue with a great atmosphere. Must-visit for BBQ lovers.',
        category: 'Food & Dining',
        icon: <RestaurantIcon />,
        priceRange: '$$',
        giftIdeas: ['BBQ Gift Cards', 'Family Feast Package', 'BBQ Sauce Collection', 'Group Dining Vouchers']
      },
      {
        name: 'Nashville Sounds Baseball',
        description: 'Minor league baseball team with a beautiful stadium. Great for sports and family experiences.',
        category: 'Sports & Entertainment',
        icon: <NightlifeIcon />,
        priceRange: '$$',
        giftIdeas: ['Game Tickets', 'Season Passes', 'VIP Experience', 'Group Outing Packages']
      },
      {
        name: 'Barcelona Wine Bar',
        description: 'Upscale Spanish tapas restaurant with extensive wine selection. Perfect for special occasions.',
        category: 'Fine Dining',
        icon: <RestaurantIcon />,
        priceRange: '$$$',
        giftIdeas: ['Wine Tasting Package', 'Dining Gift Cards', 'Tapas Experience', 'Special Event Reservations']
      }
    ]
  },
  {
    name: 'Southern Methodist University',
    hotspots: [
      {
        name: 'Knox-Henderson',
        description: 'Trendy district with boutiques perfect for student fashion and gifts',
        category: 'Shopping',
        icon: <ShoppingBagIcon />,
        priceRange: '$$$',
        giftIdeas: ['Designer Clothing', 'Accessories', 'Home Decor']
      },
      {
        name: 'The Rustic',
        description: 'Popular venue with Texas charm - great for experience gifts',
        category: 'Experiences',
        icon: <LocalBarIcon />,
        priceRange: '$$',
        giftIdeas: ['Concert Tickets', 'Dining Gift Cards', 'Texas-themed Gifts']
      },
      {
        name: 'Mi Cocina',
        description: 'Beloved Tex-Mex restaurant - perfect for foodie gifts',
        category: 'Food & Dining',
        icon: <RestaurantIcon />,
        priceRange: '$$',
        giftIdeas: ['Gift Cards', 'Cookbook', 'Tequila Tasting Experience']
      }
    ]
  }
];

const theme = createTheme({
  palette: {
    primary: {
      main: '#2E3B55',
    },
    secondary: {
      main: '#E63946',
    },
    background: {
      default: '#F1FAEE',
    },
  },
  typography: {
    fontFamily: '"Poppins", "Roboto", "Helvetica", "Arial", sans-serif',
    h4: {
      fontWeight: 600,
    },
    h5: {
      fontWeight: 600,
    },
    h6: {
      fontWeight: 600,
    },
  },
  components: {
    MuiCard: {
      styleOverrides: {
        root: {
          borderRadius: 16,
          transition: 'transform 0.2s ease-in-out',
          '&:hover': {
            transform: 'translateY(-4px)',
          },
        },
      },
    },
    MuiAppBar: {
      styleOverrides: {
        root: {
          background: 'linear-gradient(45deg, #2E3B55 30%, #1D3557 90%)',
        },
      },
    },
  },
});

function App() {
  const [selectedCollege, setSelectedCollege] = useState<College | null>(null);
  const [showHome, setShowHome] = useState(true);

  const HomePage = () => (
    <Box sx={{ textAlign: 'center', py: 8 }}>
      <Box sx={{ display: 'flex', justifyContent: 'center', mb: 4 }}>
        <CardGiftcardIcon sx={{ fontSize: 60, color: 'primary.main' }} />
        <SchoolIcon sx={{ fontSize: 60, color: 'secondary.main', ml: 2 }} />
      </Box>
      <Typography variant="h3" component="h1" gutterBottom sx={{ color: 'primary.main', fontWeight: 'bold' }}>
        OffCampus
      </Typography>
      <Typography variant="h5" color="text.secondary" sx={{ mb: 4 }}>
        The Perfect Gift Guide for College Students
      </Typography>
      <Typography variant="body1" sx={{ maxWidth: 600, mx: 'auto', mb: 6 }}>
        Find the perfect gifts and experiences for students at top universities. 
        From campus essentials to memorable experiences, we've got you covered.
      </Typography>
      <Button
        variant="contained"
        size="large"
        onClick={() => setShowHome(false)}
        sx={{
          bgcolor: 'secondary.main',
          '&:hover': {
            bgcolor: 'secondary.dark',
          },
          px: 4,
          py: 1.5,
        }}
      >
        Explore Gift Ideas
      </Button>
    </Box>
  );

  return (
    <ThemeProvider theme={theme}>
      <Box sx={{ flexGrow: 1, minHeight: '100vh', bgcolor: 'background.default' }}>
        <AppBar position="static" elevation={0}>
          <Toolbar>
            <Box sx={{ display: 'flex', alignItems: 'center', flexGrow: 1 }}>
              <CardGiftcardIcon sx={{ mr: 1 }} />
              <Typography variant="h5" component="div" sx={{ fontWeight: 'bold' }}>
                OffCampus
              </Typography>
            </Box>
            <IconButton 
              color="inherit" 
              onClick={() => setShowHome(true)}
              sx={{ ml: 2 }}
            >
              <HomeIcon />
            </IconButton>
          </Toolbar>
        </AppBar>

        <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
          {showHome ? (
            <HomePage />
          ) : (
            <Paper elevation={0} sx={{ p: 4, borderRadius: 4, bgcolor: 'white' }}>
              <Typography variant="h4" component="h1" gutterBottom sx={{ color: 'primary.main' }}>
                Find the Perfect Gift
              </Typography>

              <Typography variant="subtitle1" color="text.secondary" sx={{ mb: 4 }}>
                Select a college to discover gift ideas and popular spots near campus
              </Typography>

              <Autocomplete
                options={colleges}
                getOptionLabel={(option) => option.name}
                value={selectedCollege}
                onChange={(event, newValue) => {
                  setSelectedCollege(newValue);
                }}
                renderInput={(params) => (
                  <TextField
                    {...params}
                    label="Select a College"
                    variant="outlined"
                    fullWidth
                    sx={{ mb: 4 }}
                  />
                )}
              />

              {selectedCollege && (
                <Box sx={{ mt: 4 }}>
                  <Typography variant="h5" gutterBottom sx={{ color: 'primary.main' }}>
                    Gift Ideas Near {selectedCollege.name}
                  </Typography>
                  <Grid container spacing={3}>
                    {selectedCollege.hotspots.map((spot, index) => (
                      <Grid item xs={12} sm={6} md={4} key={index}>
                        <Card elevation={2}>
                          <CardContent>
                            <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                              <Box sx={{ color: 'primary.main', mr: 1 }}>
                                {spot.icon}
                              </Box>
                              <Typography variant="h6" component="div">
                                {spot.name}
                              </Typography>
                            </Box>
                            <Box sx={{ mb: 2 }}>
                              <Chip
                                label={spot.category}
                                size="small"
                                sx={{
                                  mr: 1,
                                  bgcolor: 'primary.main',
                                  color: 'white',
                                }}
                              />
                              <Chip
                                label={spot.priceRange}
                                size="small"
                                sx={{
                                  bgcolor: 'secondary.main',
                                  color: 'white',
                                }}
                              />
                            </Box>
                            <Typography variant="body2" color="text.secondary" sx={{ mb: 2 }}>
                              {spot.description}
                            </Typography>
                            <Typography variant="subtitle2" sx={{ color: 'primary.main', mb: 1 }}>
                              Popular Gift Ideas:
                            </Typography>
                            <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                              {spot.giftIdeas.map((gift, idx) => (
                                <Chip
                                  key={idx}
                                  label={gift}
                                  size="small"
                                  variant="outlined"
                                  icon={<FavoriteIcon sx={{ fontSize: 16 }} />}
                                />
                              ))}
                            </Box>
                          </CardContent>
                        </Card>
                      </Grid>
                    ))}
                  </Grid>
                </Box>
              )}
            </Paper>
          )}
        </Container>
      </Box>
    </ThemeProvider>
  );
}

export default App;
